//import Link from 'next/link';

const linkStyle = {
    marginRight: 15
}

const Nav = () => (
    <div>
         <a href="/" style={linkStyle}>Home</a>
        
        <a href="/info" style={linkStyle}>Info</a>
        
    </div>
)

export default Nav;
